import logo from './logo.svg';
import './App.css';
import Header from "./components/Header"

function App() {
  return (
    <div className="App">
      <Header/>
      <Header/>
      <Header/>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          This is first reactjs app.
        </p>
      </header>
    </div>
  );
}

export default App;
